    false,nt"url": null,nt"notes": "<p>The Recovery Audit Programs mission
    is to identify and correct Medicare improper payments through the efficient detection
    and collection of overpayments made on claims of health care services provided to
    Medicare beneficiaries, and the identification of underpayments to providers so
    that the CMS can implement actions that will prevent future improper payments in
    all 50 states.</p>n",nt"license_title": "License Not Specified",nt"extras":
